// src/index.js
import React from 'react';
import ReactDOM from 'react-dom';
import './App.css'; // Importing the global CSS for your app
import App from './App'; // Importing the main App component
import { BrowserRouter as Router } from 'react-router-dom'; // Wrap your App with Router to enable routing

// Rendering the App component inside the root div in index.html
ReactDOM.render(
  <React.StrictMode>
    <Router>
      <App />  {/* Your main application component */}
    </Router>
  </React.StrictMode>,
  document.getElementById('root') // 'root' is the ID of the div in index.html
);
